import { Card } from "react-bootstrap";

const Song = (props) => {
  return (
    <Card>
      <img src={props.song.img} alt={props.song.title}></img>
      <h3 style={{ paddingLeft: "0.2rem" }}>{props.song.title}</h3>
      <h5>by {props.song.artist}</h5>
      <p>
        {props.song.genre} | {props.song.year} | {props.song.length}
      </p>
      <button type="button" class="btn btn-primary">
        Add to Favorites
      </button>
    </Card>
  );
};

export default Song;
